import { Box } from '@mui/system'
import React from 'react'

const Rightbar = () => {
  return (
    <Box bgcolor='lightseagreen' flex={2} p={2}
    sx={{display:{sx}}}>
        Rightbar
    </Box>
  )
}

export default Rightbar
